webpackJsonp([0xcb4e86eb89b7],{4211:function(a,t){a.exports={data:{markdownRemark:{html:'<p>Webサイトじゃなくて、まくの生息地(兼danmaq本部)のことね。5/30よりdanmaq本部は東京板橋区・高島平から東京墨田区・東向島へ引っ越します。よってその5/28～6/10の間はdanmaqゲーム製作をはじめ、<a href="http://e.danmaq.com/">通販</a>他一切の活動を一時停止いたしますので、もし御用の方いらっしゃいましたらお早めにどうぞ。</p>\n<p>しかし、やっぱり東京都区部内で5万で全うな物件探すのは無理があったぽい。あと、やっぱ狭くなった(1LDK→1DK、面積比3:2)。こればっかりは仕方ないのかなぁ。</p>',frontmatter:{cover:null,date:"2009-05-18T13:40:00+09:00",strDate:"2009/5/18",title:"danmaqは移転します"}}},pathContext:{path:"/ja/blog/2009/05/18-danmaqは移転します/",langKey:"ja"}}}});
